sys_variable_value.value:
(function execute(inputs, outputs) {

  if (inputs.dryRun) {
    outputs.dryrun = "1";
  }

  if (inputs.suppressLayouts) {
    outputs.suppresslayouts = "1";
  } else {
    outputs.suppresslayouts = "0";
  }

  if (inputs.failFast) {
    outputs.failfast = "1";
  } else {
    outputs.failfast = "0";
  }

})(inputs, outputs);

