sys_variable_value.value:
(function execute(inputs, outputs) {
  var eventCode = 'sns-xray-copy-item';  
  try{
      var xmu = new XrayMetricUtil();
      var resPayload = xmu.postHeapMetrics(inputs.jpdUrl, eventCode);
  }
  catch(ex) {
    gs.error(ex.getErrorMsg());
  }
  outputs.payload = JSON.stringify(resPayload);
})(inputs, outputs);

